import React from "react";
import PieChartFood from "./PieChartFood";
import PieChartBeverage from "./PieChartBeverage";
import BarChartComponent from "./BarChartComponent";
import RouteLineChart from "./RouteLineChart";
import inflightLogo from "../assets/inflight-logo.png";

function Dashboard() {
  return (
    <div style={{ padding: "2rem", backgroundColor: "white" }}>
      {/* Header with logo and title */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          marginBottom: "1rem",
        }}
      >
        <img
          src={inflightLogo}
          alt="In-Flight Insights Logo"
          style={{ height: "60px", width: "60px", marginRight: "10px" }}
        />
        <h1 style={{ fontSize: "2rem", color: "#2c65c8", margin: 0 }}>
          ‚úàÔ∏è In-Flight Insights Dashboard
        </h1>
      </div>

      {/* KPI boxes */}
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          marginBottom: "2rem",
          flexWrap: "wrap",
          gap: "1rem",
        }}
      >
        {[
          { icon: "üí∞", title: "Cost Savings", value: "$1.2M" },
          { icon: "‚ôªÔ∏è", title: "Waste Saved", value: "210 kg" },
          { icon: "üõ´", title: "Routes Analyzed", value: "350" },
          { icon: "üåç", title: "CO‚ÇÇ Saved", value: "28 tonnes" },
        ].map((kpi, idx) => (
          <div
            key={idx}
            style={{
              flex: "1",
              minWidth: "200px",
              background: "linear-gradient(to right, #e0f7e9, #e6f2fb)",
              padding: "1rem",
              borderRadius: "12px",
              textAlign: "center",
              boxShadow: "0px 0px 6px rgba(0, 0, 0, 0.1)",
            }}
          >
            <h3 style={{ margin: 0 }}>
              {kpi.icon} <strong>{kpi.title}</strong>
            </h3>
            <p style={{ fontSize: "1.8rem", marginTop: "0.5rem", fontWeight: "bold" }}>
              {kpi.value}
            </p>
          </div>
        ))}
      </div>

      {/* Pie Charts and Route Line Chart */}
      <div
        style={{
          display: "flex",
          flexWrap: "wrap",
          gap: "1.5rem",
          marginBottom: "2rem",
        }}
      >
        {/* Pie Chart Box */}
        <div
          style={{
            flex: 1,
            backgroundColor: "#f9f9f9",
            padding: "1.5rem",
            borderRadius: "12px",
            minWidth: "340px",
            boxShadow: "0px 0px 4px rgba(0, 0, 0, 0.05)",
          }}
        >
          <h2 style={{ textAlign: "center", fontSize: "1.2rem" }}>Consumption Breakdown</h2>
          <div style={{ display: "flex", justifyContent: "space-around" }}>
            <div>
              <h4 style={{ textAlign: "center" }}>Food</h4>
              <PieChartFood />
            </div>
            <div>
              <h4 style={{ textAlign: "center" }}>Beverages</h4>
              <PieChartBeverage />
            </div>
          </div>
        </div>

        {/* Route Line Chart */}
        <div
          style={{
            flex: 1,
            backgroundColor: "#f9f9f9",
            padding: "1.5rem",
            borderRadius: "12px",
            minWidth: "340px",
            boxShadow: "0px 0px 4px rgba(0, 0, 0, 0.05)",
          }}
        >
          <h2 style={{ textAlign: "center", fontSize: "1.2rem" }}>Route-Specific Waste Trend</h2>
          <RouteLineChart />
        </div>
      </div>

      {/* Bar Chart Below */}
      <div style={{ marginTop: "2rem" }}>
        <h2 style={{ fontSize: "1.2rem" }}>Waste by Age Group</h2>
        <BarChartComponent />
      </div>
    </div>
  );
}

export default Dashboard;
